   Sahi Dhandhe Galat Bande is the story of   
   a gang comprised of four friends-Rajbir,   
   Sexy , Ambani and Doctor who are given a   
   job which will give them enough money to   
   make all their dreams come true, but to    
   achieve the same they will have to go      
   against their conscience and the village,  
   Kanjhawla, to which they belong. Goading   
   them on to make this job successful is     
   their boss, Fauji , who stands to gain the 
   most from the job's success and realize his
   dreams of becoming a politician.           




